clawMotor = Motor(Port.B, Direction.COUNTERCLOCKWISE)
backMotor = Motor(Port.A, Direction.CLOCKWISE)
driveBase = DriveBase(rightMotor, leftMotor, 56, 195)

# Initialize variables.
error = 0
correcion = 0
velocidad = 60
elementX = 0

def girar2(angulo):
    if angulo >= prime_hub.imu.heading():
        while prime_hub.imu.heading() <= angulo:
            leftMotor.run((angulo - prime_hub.imu.heading()) * 9 + 60)
    else:
        while prime_hub.imu.heading() >= angulo:
            rightMotor.run((prime_hub.imu.heading() - angulo) * 9 + 60)
        while prime_hub.imu.heading() <= angulo:
            rightMotor.run((angulo + prime_hub.imu.heading()) * 9 + 60)
    rightMotor.hold()
    leftMotor.hold()

def stopMotors():
    rightMotor.brake()
    leftMotor.brake()

def startTurning():
    driveBase.straight(140)
    while not lineSensor.reflection() <= 50:
        rightMotor.run(500)
    rightMotor.stop()

def girar(angulo):
    if angulo >= prime_hub.imu.heading():
        while prime_hub.imu.heading() <= angulo:
            leftMotor.run((angulo - prime_hub.imu.heading()) * 9 + 60)
            rightMotor.run((prime_hub.imu.heading() - angulo) * 9 - 60)
    else:
        while prime_hub.imu.heading() >= angulo:
            leftMotor.run((angulo - prime_hub.imu.heading()) * 9 - 60)
            rightMotor.run((prime_hub.imu.heading() - angulo) * 9 + 60)
    stopMotors()

def openClaw(isOpen):
    if isOpen == 0:
        clawMotor.run(200)
    else:
        clawMotor.run(-200)

def turningToGrab():
    driveBase.straight(-50)
    rightMotor.run_angle(800, 120)
    driveBase.straight(125)
    rightMotor.run_angle(800, -790)
    openClaw(0)
    wait(1000)
    driveBase.straight(180)
    openClaw(1)
    wait(1000)
    driveBase.straight(-55)

def possibleCombinations():
    global elementX
    if elementX > 6:
        elementX = 4
    elif elementX == 3:
        elementX = 2
    else:
        pass

def isFlowerOrDuck():
    global elementX
    if elementSensor.reflection() > 5 and elementSensor.reflection() < 13:
        elementX = elementX + 1
        print('FLOR', ' ', elementSensor.reflection(), ' ', elementX)
    elif elementSensor.reflection() >= 13 and elementSensor.reflection() < 30:
        elementX = elementX + 4
        print('PATO', ' ', elementSensor.reflection(), ' ', elementX)
    else:
        pass

def lineFollow():
    global error, correcion
    error = lineSensor.reflection() - 50
    correcion = error * 0.4
    leftMotor.dc(velocidad - correcion)
    rightMotor.dc(velocidad + correcion)

def grabCable(openClose):
    if openClose == 1:
        backMotor.run_angle(300, 90)
    else:
        backMotor.run_angle(300, -90)


# The main program starts here.
prime_hub.imu.reset_heading(0)
while not Button.RIGHT in prime_hub.buttons.pressed():
    wait(1)
wait(500)
startTurning()
driveBase.settings(straight_speed=220)
while True:
    if elementSensor.reflection() > 5:
        driveBase.straight(15, Stop.NONE)
        isFlowerOrDuck()
        driveBase.straight(15, Stop.NONE)
        if elementX == 6:
            break
        else:
            possibleCombinations()
    else:
        lineFollow()
turningToGrab()
stopMotors()
while not lineSensor.reflection() < 50:
    leftMotor.dc(-30)
    rightMotor.dc(30)
rightMotor.track_target(35)
stopMotors()
while not lineSensor.reflection() > 96:
    lineFollow()
rightMotor.brake()
leftMotor.brake()
girar2(-177)
driveBase.straight(-450)
grabCable(1)
driveBase.straight(140)
girar(-320)
driveBase.straight(-580)
prime_hub.speaker.beep(500, 100)
girar(-270)
driveBase.straight(-240)
driveBase.straight(120)
girar(-180)
driveBase.straight(500)
girar(-90)
driveBase.straight(140)
openClaw(0)
wait(1000)
driveBase.straight(-140)
openClaw(1)
girar(-180)
while not lineSensor.reflection() > 96:
    rightMotor.run(500)
    leftMotor.run(500)
stopMotors()
print('------------------------------------------------------------------')
